const spacing = [0, 5, 8, 13, 21, 34, 55];
export default {
  spacing: (n) => spacing[n],
  backgroundColor: "rgb(244, 244, 244)",
  color: "#333",
  secondary: "#c0c0c0",
  primary: "brown",
  bgHighlight: "#f7f8f9",
};
